import React from 'react';

function GameTypes() {
  return (
    <div className='containerGameTypes'>
        <div className='gametype'>
            Bullet
        </div>
        <div className='gametype'>
            Blitz
        </div>
        <div className='gametype'>
            Rapid
        </div>
        <div className='gametype'>
            Daily
        </div>
    </div>
  )
}

export default GameTypes;
